import React from "react";
import TodoItem from "./TodoItem";

const TodoList = ({ todos }) => {
  return (
    <div>
      {todos.map((todo) => {
        return <div>{todo.text}</div>;
      })}
      <TodoItem todo={todo} key={todo.id} />
    </div>
  );
};

export default TodoList;
